//https://leetcode.com/contest/leetcode-weekly-contest-2/problems/find-the-difference/
public class FindTheDifferenceString {
    public static void main(String[] args) {
        System.out.println(findTheDifference(""
            ,""));
        System.out.println(findTheDifference("abcd","abcde"));
    }

    static char findTheDifference(String s, String t) {
        int n = s.length();
        int tn = t.length();
        if(n==0){
            return t.charAt(0);
        }

        int[] st = new int[26];
        for(int i=0; i<n; i++){
            st[s.charAt(i)-'a']++;
        }

        int[] tt = new int[26];
        for(int i=0; i<tn; i++){
            tt[t.charAt(i)-'a']++;
        }

        char c = ' ';
        for(int i=0; i<26; i++){
            if(st[i] != tt[i]){
                c = (char)('a'+i);
                break;
            }
        }

        return c;

    }
}
